.wrapper {
    width: 100%;
    height: 100vh;
    display: flex;
    flex-direction: row;
    flex-wrap: wrap;

    .loading-screen {
        width: inherit;
        height: inherit;
        display: flex;
        align-items: center;
        justify-content: center;

        .loading-screen-content {
            display: flex;
            justify-content: center;
            align-items: center;

            h1 {
                user-select: none;
                font-weight: 500;
            }

            .glow-div {
                position: relative;
                height: 80px;
                width: 80px;

                .hide {
                    display: none;
                }

                .infinity {
                    cursor: pointer;
                    position: absolute;
                    left: -12px;
                    height: 80px;
                    width: 80px;
                    user-select: none;
                    -moz-user-select: none;
                }

                .snap {
                    position: absolute;
                    top: 0;
                    left: -12px;
                    height: 80px;
                    width: 80px;
                    background-image: url('../assets/img/thanos_snap.png');
                    background-position: left;
                    background-repeat: no-repeat;
                    animation: snaps 2s steps(47);
                }

                @keyframes snaps {
                    from {
                        background-position: left;
                    }

                    to {
                        background-position: right;
                    }
                }
            }
        }
    }

    .main-content{
        width: 100%;
    }
}

